"87230":{"id":"87230","name":"Rubirosa: O Último Playboy","slug":"rubirosa-o-ultimo-playboy","original_title":"Rubirosa","overview":"Em meados do século XX, um playboy da República Dominicana se infiltra no governo do ditador militar que comanda o seu país. Porém, a sua missão é interferida quando ele se apaixona pela filha do ditador.","first_air_date":"2018-09-27","episode_run_time":42,"vote_average":5.1,"number_of_seasons":1,"number_of_episodes":12,"created_by":["Juancho Cardona"],"production_companies":["11:11 Films & TV"],"genres":["Drama"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/qwFd0db5mBPtqX6svZI4Wbpud0P.jpg","poster_path":"https://image.tmdb.org/t/p/original/kJmM4bhWwmD28iXOsQesqtGrCk4.jpg","cast":["Carolina Guerra","Hony Estrella","Margarita Muñoz","Damián Alcázar","Ana Serradilla"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/3t5bSFthfw8qV6fyHZ1Q1tbCDkP.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/3t5bSFthfw8qV6fyHZ1Q1tbCDkP.jpg","air_date":"2018-09-27","episode_count":12,"overview":"N/A","vote_average":10,"episodes":{"1":{"name":"O Tigre","overview":"Rubi vive com a sua família em Paris, onde aprende a agradar às mulheres. Já Rafael Trujillo assume o governo da República Dominicana. Ao retornar, Rubi se reúne com Candelaria, membro da oposição, e sofre a primeira tragédia da sua vida.","air_date":"2018-09-27","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/zlafBqR2DDuAj8JyldUpGUhBsl8.jpg","vote_average":10},"2":{"name":"O Infiltrado","overview":"Flor retorna à República Dominicana por causa da demanda do seu pai. Rubi se junta à oposição e, junto com Candelaria, começa a atacar Trujillo. Rubirosa decide aproveitar o desejo de Trujillo de fazer parte da alta sociedade.","air_date":"2018-10-04","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/xsQPrFTwS5LPfHuDRJjCftXkvUM.jpg","vote_average":0},"3":{"name":"Relações Proibidas","overview":"Ao serem perseguidos pelos homens de Trujillo, Rubi e Flor têm o seu primeiro encontro amoroso, o que poderia ter consequências desastrosas.","air_date":"2018-10-11","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/lRnHRcjnqMIm4UFHTChQmusa8wt.jpg","vote_average":0},"4":{"name":"Tentações Perigosas","overview":"Trujillo começa uma caçada aos haitianos. Flor e Rubi tentam começar um negócio com o dinheiro do seu dote para não depender do Generalíssimo. Candelaria é ameaçada pelo povo de Trujillo.","air_date":"2018-10-18","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/xGdcTyiaX7wvRep0JZjrYpyaQ29.jpg","vote_average":0},"5":{"name":"Desafiando o Tirano","overview":"Rubirosa ajuda Candelaria a sair da República Dominicana. Flor e Rubi se mudam para Nova York, onde a sorte não está do lado deles.","air_date":"2018-10-25","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/yWbQRYkIZeSt1ureGtBW17Mblie.jpg","vote_average":0},"6":{"name":"Na Mira","overview":"Rubirosa é enviado para a Alemanha nazista. Por ordens de Trujillo, Rubi deve tirar proveito das suas habilidades sedutoras para conseguir aliados para o Generalíssimo.","air_date":"2018-11-01","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/xinQnRU5xSyJpJrK9NbQldvMN6v.jpg","vote_average":0},"7":{"name":"Dívidas do Passado","overview":"A oposição planeja o assassinato de Trujillo em Paris. Rubi conhece Denisse e imediatamente se apaixona. A invasão dos alemães coloca Rubi na mira de Otto novamente, que busca vingança.","air_date":"2018-11-08","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/gJamNYGKjbRUFNZtbWvGGIInws.jpg","vote_average":0},"8":{"name":"Golpe de Mestre","overview":"Flor tenta reconstruir a sua vida, mas sofre mais uma tragédia. Na República Dominicana, Candelaria procura se aproximar de Ramfis. Doris aparece na vida de Rubi e ameaça separá-lo de Denisse.","air_date":"2018-11-15","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/vnM5u4P2UdrgsqaQOf7Ll0gTmVz.jpg","vote_average":0},"9":{"name":"Reencontro","overview":"Flor retorna à vida de Rubi e Trujillo decide se envolver na reconciliação. O FBI segue os passos de Rubirosa e alerta a sua futura esposa.","air_date":"2018-11-22","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/kA24KDvrk2qpRKY8oxsmZx2vkz3.jpg","vote_average":0},"10":{"name":"Regime do Terror","overview":"Trujillo envia Rubi para a Argentina para investigar os planos do governo peronista. Uma grande confusão faz com que Rubi finja estar envolvido em um caso com a primeira dama. Ramfis procura refúgio na filha de um dos adversários do seu pai.","air_date":"2018-11-29","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/9u8wz57n66VZrHJP0sgJF7TlvFO.jpg","vote_average":0},"11":{"name":"Cheque-Mate","overview":"Rubi conhece Zsa Zsa Gabor e eles começam um romance. Candelaria consegue publicar o livro de Aguirre, embora isso coloque a sua vida em perigo. Guillermo segue Rubi para verificar se ele faz parte da oposição.","air_date":"2018-12-06","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/sftVE7qyRJopdEGh63ledVYmD3G.jpg","vote_average":0},"12":{"name":"O Começo da Lenda","overview":"A convite de Trujillo, Rubi retorna à República Dominicana. O Generalíssimo descobre a traição de um dos seus homens mais próximos. Enquanto isso, a resistência se torna cada vez mais radical, a fim de libertar a República Dominicana da tirania.","air_date":"2018-12-13","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/4psalLj8Wb01FXOXrr8X5IP5xWQ.jpg","vote_average":0}}}}},
