"112581":{"id":"112581","name":"Mistério no Mar","slug":"misterio-no-mar","original_title":"The Rig","overview":"Quando a tripulação da Kinloch Bravo vê que a comunicação com o continente escocês foi interrompida por uma névoa misteriosa, eles devem lutar para irem para casa enquanto gerenciam as pressões ambientais, a paranoia crescente e as tensões inervantes. Quando ameaça que enfrentam revela ser algo além de sua imaginação, a tripulação dividida deve formar uma aliança para garantir a sobrevivência.","first_air_date":"2023-01-06","episode_run_time":0,"vote_average":6.7,"number_of_seasons":2,"number_of_episodes":12,"created_by":["David Macpherson"],"production_companies":["Wild Mercury Productions"],"genres":["Drama","Mistério","Sci-Fi & Fantasy"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/bGMLZoRtfIY0OxtCOpZiwkUzeQl.jpg","poster_path":"https://image.tmdb.org/t/p/original/kx3QDUtT5tQ8GVYgzCFeIznsjA4.jpg","cast":["Emily Hampshire","Iain Glen","Martin Compston","Rochenda Sandall","Owen Teale"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/R6OR3makLNr3dMPnDrr2x4Xi3C.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/R6OR3makLNr3dMPnDrr2x4Xi3C.jpg","air_date":"2023-01-06","episode_count":6,"overview":"N/A","vote_average":5.2,"episodes":{"1":{"name":"Episódio 1","overview":"A tripulação do Kinloch Bravo se vê presa em sua plataforma petrolífera após uma misteriosa névoa envolver o local, trazendo uma crescente sensação de mal-estar que começa a afetar todos a bordo.","air_date":"2023-01-06","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/gF55X6Rzg1yVOvoINhBe4edjiSe.jpg","vote_average":5.643},"2":{"name":"Episódio 2","overview":"O aparecimento da embarcação de apoio aumenta as esperanças de fuga da equipe, fazendo com que Rose trabalhe sem parar para descobrir a natureza científica das misteriosas cinzas. Mas com as tensões aumentando, alguns são compelidos a tomar a situação em suas próprias mãos com sérias consequências.","air_date":"2023-01-06","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/whe8VfoaQrX0HeeOuc6KGzAkzgM.jpg","vote_average":5.615},"3":{"name":"Episódio 3","overview":"Com Baz desaparecido e considerado perigoso, a equipe se divide em grupos para encontrá-lo. Rose faz uma descoberta impactante e a caçada fica ainda mais assustadora e misteriosa quando a tripulação é atingida por falhas de energia e paranoia.","air_date":"2023-01-06","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/sPFfYBkxii3nPsa2MyrRSoLPPCb.jpg","vote_average":5.545},"4":{"name":"Episódio 4","overview":"Baz e Garrow ficam mais próximos de entender sua missão quando exploram a sala de controle da bomba e percebem que precisam de Fulmer para ajudá-los, trazendo consequências dolorosas enquanto ele luta para manter o controle de sua sanidade.","air_date":"2023-01-06","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/siuwXmG7QmwgqOQPGMfZIh8VBjT.jpg","vote_average":5.25},"5":{"name":"Episódio 5","overview":"A presença dos recém-chegados a bordo da Kinloch Charlie é sentida imediatamente. O chefe da Pictor, Coake, alista um grupo para minar o poder de Magnus e forçar seu caminho até o controle da bomba. Mas quando os motivos de Coake são investigados, a equipe percebe que ele não está revelando toda a verdade.","air_date":"2023-01-06","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/mkHY1oZomtX4Rnpu2RrfRKaREDZ.jpg","vote_average":4.818},"6":{"name":"Episódio 6","overview":"Coake é pressionado a explicar o plano da Pictor e o real motivo de sua missão. Rose e Fulmer descobrem o terrível significado das mensagens codificadas. Magnus luta contra seus próprios demônios em uma tentativa final de sobrevivência.","air_date":"2023-01-06","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/kPuOZ8eAIo4Vik9Uf4YsWdvVWpg.jpg","vote_average":4.3}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/kx3QDUtT5tQ8GVYgzCFeIznsjA4.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/kx3QDUtT5tQ8GVYgzCFeIznsjA4.jpg","air_date":"2025-01-02","episode_count":6,"overview":"N/A","vote_average":6,"episodes":{"1":{"name":"Episódio 1","overview":"N/A","air_date":"2025-01-02","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/hJwlg6pyaxFfnx3Txv2KIKXYLKV.jpg","vote_average":6},"2":{"name":"Episódio 2","overview":"N/A","air_date":"2025-01-02","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/pJuATJGTjEa5T3bSZPryi0QOi1C.jpg","vote_average":6},"3":{"name":"Episódio 3","overview":"N/A","air_date":"2025-01-02","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/nzFBPtXkZ50Z1BqtBvTKPJzG1Kn.jpg","vote_average":6},"4":{"name":"Episódio 4","overview":"N/A","air_date":"2025-01-02","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/qpd0QQ4Tmx0NqpmI1bOaRvjtGje.jpg","vote_average":6},"5":{"name":"Episódio 5","overview":"N/A","air_date":"2025-01-02","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/cyLFGEismgbS7NqMvMhen64eORJ.jpg","vote_average":6},"6":{"name":"Episódio 6","overview":"N/A","air_date":"2025-01-02","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/tirKtoRXe0FW59stQhMoye4LXQi.jpg","vote_average":6}}}}},
