"58810":{"id":"58810","name":"Crossbones","slug":"crossbones","original_title":"Crossbones","overview":"É 1715 na ilha de New Providence, nas Bahamas, a primeira democracia em funcionamento nas Américas, onde o diabólico pirata Edward Teach, também conhecido como Barba Negra, reina sobre uma nação desonesta de ladrões, bandidos e marinheiros malvados. Parte favela, parte do paraíso dos marauders, este é um lugar sem igual na Terra - e uma ameaça crescente ao comércio internacional. Para ganhar o controle desta sociedade temível, Tom Lowe, um assassino disfarçado altamente qualificado, é enviado ao refúgio dos bucaneiros para derrubar o brilhante e carismático Barba Negra. Mas quanto mais próximo Lowe fica, mais ele descobre que sua busca não é tão simples. Lowe não pode deixar de admirar os ideais políticos de Barba Negra, cuja sede de conhecimento não conhece limites - e nenhuma lei. Mas Lowe não é o único perigo para o domínio do Barba Negra. Ele é um homem com muitos rivais malvados e uma grande fraqueza - uma mulher apaixonada que ele não pode negar.","first_air_date":"2014-05-30","episode_run_time":42,"vote_average":6.034,"number_of_seasons":1,"number_of_episodes":9,"created_by":["Neil Cross"],"production_companies":["Mr. Cross","Universal Television","Parkes+MacDonald Image Nation","Parkes/MacDonald Productions"],"genres":["Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/aO84eFkb0X8OMDnGTVMh3Ypttfo.jpg","poster_path":"https://image.tmdb.org/t/p/original/l1FvNiEC61VvuNPkaKMseDXnDGc.jpg","cast":["John Malkovich","Richard Coyle","Yasmine Al Massri","David Hoflin","Claire Foy"],"trailer":"N/A","seasons":{"0":{"name":"Especiais","poster_path":"https://image.tmdb.org/t/p/originalnull","backdrop_path":"https://image.tmdb.org/t/p/originalnull","air_date":"2014-05-14","episode_count":1,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Episódio 1","overview":"N/A","air_date":"2014-05-14","runtime":42,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}},"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/t3C8oLlr5g3vlqEHCcToNsbcRQT.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/t3C8oLlr5g3vlqEHCcToNsbcRQT.jpg","air_date":"2014-05-30","episode_count":9,"overview":"N/A","vote_average":7.2,"episodes":{"1":{"name":"O Domínio do Diabo","overview":"O cronômetro de comprimento é roubado de HMS Petrel por piratas que trabalham para o lendário, mas supostamente morto, Edward Teach - Barba Negra. A bordo do Petrel está Tom Lowe, um espião inglês que trabalha disfarçado. A missão de Lowe é impedir que o cronômetro caia nas mãos dos piratas e se surgir a oportunidade de assassinar Barba Negra.","air_date":"2014-05-30","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/5cO6t1oElCDnMbNEqhXthHvjK8e.jpg","vote_average":5.7},"2":{"name":"O Pacto","overview":"Os planos de Barba Negra são complicados quando um conhecido capitão pirata chega à cidade e se opõe a seus planos de maneira violenta. Para conseguir seu plano mestre de sobrevivência, Barba Negra deve pesar os riscos de se livrar de seu velho e perigoso amigo.","air_date":"2014-06-06","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/cHWljAqiHdyQKIloYIUD9pkOrpU.jpg","vote_average":6.8},"3":{"name":"O Homem que Matou o Barba Negra","overview":"Quando Kate é capturada durante uma viagem comercial, Barba Preta e Lowe devem se juntar para resgatá-la antes que ela revele o paradeiro da ilha para William Jagger. No processo, Lowe descobre que o Barba Preta tem um motivo oculto e profundamente pessoal que o mantém em alerta.","air_date":"2014-06-20","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/hqcvZtXfenzUQUmUEZhtN7ZVuN3.jpg","vote_average":6.8},"4":{"name":"Antonieta","overview":"Ao saber dos planos de Barba Preta de atacar civis inocentes na Jamaica, Lowe inventou uma maneira de informar seu mestre espião, William Jagger. Mas ao fazê-lo, Lowe descobre que Jagger poderia ser um louco ainda maior do que o Commodore. Chegou a hora de escolher entre dois males.","air_date":"2014-06-27","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/nNPHuokCskuOy5lQdiFhOsVnOyh.jpg","vote_average":8},"5":{"name":"O Retorno","overview":"Lowe planeja sequestrar Barba Preta e entregá-lo às autoridades inglesas, acreditando que esta é a única maneira de salvar o povo de Santa Campana da ira de William Jagger. Enquanto isso, Jagger visita um asilo, acreditando que um paciente será a chave para finalmente derrotar a Barba Preta.","air_date":"2014-07-11","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/5IgLtLuk9SbLPFiSUTxhsZccdo5.jpg","vote_average":6},"6":{"name":"Um Buraco na Cabeça","overview":"Balfour ouve Lowe confessar a Kate que ele é um espião inglês enviado para matar Barba Preta e diz a Selima para enviar piratas para encontrar Lowe. Jagger quebra o código: o cronômetro do Barba Preta vendido aos espanhóis levará a frota a um ataque surpresa de Barba Negra, o único que sabe onde estarão os espanhóis e seu tesouro.","air_date":"2014-07-18","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/zlNlz6P6igH5YJJ7dCgbWvZUY4b.jpg","vote_average":8.8},"7":{"name":"Mendigo","overview":"Com poucos aliados em Santa Campana, as coisas pioram para Lowe quando os planos de fuga de Nenna o colocam em sua mira. Enquanto isso, Balfour faz uma aliança inesperada que pode custar a vida de Lowe e dele.","air_date":"2014-07-25","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/8VpLTyTgzRdQOrKFXAbRMmHQsAC.jpg","vote_average":5},"8":{"name":"Ossos Cruzados","overview":"Sob a pressão de um misterioso e poderoso senhor da guerra , Barba Preta despacha Rider, Nenna e Tom Lowe para realizar uma incursão ousada em um bastião espanhol. Mas Lowe está longe de ser bem-vindo nesta missão.","air_date":"2014-08-02","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/n0xyJoPEs9xHmu6mtvTM0ssmgvC.jpg","vote_average":9},"9":{"name":"Barba Negra","overview":"O fogo cai em Santa Campana enquanto Barba Preta arrisca a todos contra o ataque maníaco de William Jagger. Lowe deve escolher entre salvar as pessoas que ele ama, o homem que ele admira e o legado que Edward Teach construiu.","air_date":"2014-08-02","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/hp2rJX7ecyhkSTFOUd0fm0p6BsU.jpg","vote_average":9}}}}},
