"138561":{"id":"138561","name":"Kindred: Segredos e Raízes","slug":"kindred-segredos-e-raizes","original_title":"Kindred","overview":"Quando Dana, uma jovem negra e aspirante a escritora, começa a se estabelecer em sua nova casa, ela se vê viajando entre o passado e o presente, surgindo em uma plantação do século XIX e confrontando segredos que ela nunca soube que corriam em seu sangue.","first_air_date":"2022-12-13","episode_run_time":0,"vote_average":6.5,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Branden Jacobs-Jenkins"],"production_companies":["FX Productions","Protozoa Pictures"],"genres":["Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/nCy0y2zbHt8y7Behadt9SaYfE0Q.jpg","poster_path":"https://image.tmdb.org/t/p/original/yMxeqvMSc3JITR82BAsPf6Mzk7d.jpg","cast":["Mallori Johnson","Micah Stock","Ryan Kwanten","Gayle Rankin","Austin Smith"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/yMxeqvMSc3JITR82BAsPf6Mzk7d.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/yMxeqvMSc3JITR82BAsPf6Mzk7d.jpg","air_date":"2022-12-13","episode_count":8,"overview":"N/A","vote_average":8.7,"episodes":{"1":{"name":"Dana","overview":"Dana chega à cidade esperando uma recepção calorosa da família, mas ela se depara com o oposto. Algum conforto chega na forma de um novo amigo.","air_date":"2022-12-13","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/ocLxB2I7eVqgKw5t1qRq0ZCbE8N.jpg","vote_average":9.4},"2":{"name":"Sabina","overview":"Um vizinho intrometido coloca o tipo errado de holofote em Dana antes que uma queda feia desencadeie uma viagem de volta ao passado. Kevin ganha experiência em primeira mão com os problemas de Dana, pois a dupla é forçada a desempenhar papéis desconfortáveis para se manter fora de perigo.","air_date":"2022-12-13","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/rk31IozyAozKbybSoTnIZV6KdsH.jpg","vote_average":8.5},"3":{"name":"Furniture","overview":"Dana e Olivia procuram a resposta para o que continua trazendo Dana de volta ao passado. Kevin age como um gracioso festeiro a pedido de seus anfitriões.","air_date":"2022-12-13","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/vVCygSZZEnhZqus0XKiWGnsUehf.jpg","vote_average":8.7},"4":{"name":"O Garçom de Duas Noites Atrás","overview":"De volta a Los Angeles, Dana e Kevin se preparam para voltar ao passado, mas precisam lidar com as consequências familiares de suas viagens.","air_date":"2022-12-13","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/7tvoqptPglq44U1pSOiJIq6t7lF.jpg","vote_average":9},"5":{"name":"Winnie","overview":"Dana e Kevin voltam para a fazenda. Um confronto com Olivia faz Dana reavaliar seu propósito. Kevin deve encontrar uma maneira de explicar seu misterioso retorno à família Weylin.","air_date":"2022-12-13","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/gsuAPlnCuB0ZWw3Y2Vb0uBXTJzb.jpg","vote_average":8.7},"6":{"name":"Celeste","overview":"A população escravizada enfrenta consequências imprevistas das ações bem-intencionadas de Dana. A busca de Margaret pela futura esposa de Rufus leva Kevin a se aprofundar no drama familiar.","air_date":"2022-12-13","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/5KUCCo6GM8z8aP9IgQdt3LwKDkp.jpg","vote_average":8.3},"7":{"name":"Jane","overview":"Tom leva Kevin e Rufus em uma viagem à cidade. Sem a proteção de Kevin na plantação, Dana luta com a vingativa Margaret.","air_date":"2022-12-13","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/iJ9kDjJ2Ix77hSdySOPKQOuWkoh.jpg","vote_average":8},"8":{"name":"Alice","overview":"Dana se encontra em uma situação terrível. Kevin persegue um escravo fugitivo. Tom procura restabelecer a ordem em sua plantação.","air_date":"2022-12-13","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/6jE3CABF3P9Xmh7IpVhDun6JllQ.jpg","vote_average":8.7}}}}},
