"123381":{"id":"123381","name":"Desjuntados","slug":"desjuntados","original_title":"Desjuntados","overview":"Um casal em um relacionamento sério com o divórcio. Camila e Caco já não se suportam mais e veem seu casamento chegar ao fim, mas durante o processo de separação eles são obrigados a continuarem dividindo o mesmo teto por causa de uma dívida.","first_air_date":"2021-10-01","episode_run_time":0,"vote_average":5.7,"number_of_seasons":1,"number_of_episodes":7,"created_by":["Daniele Valente","Mina Nercessian"],"production_companies":["FJ Productions"],"genres":["Comédia"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/s28QU102KixRux8FP2W9WlwOWlK.jpg","poster_path":"https://image.tmdb.org/t/p/original/omkz52Su5eyFOQnc8klBWRaJpT.jpg","cast":["Letícia Lima","Gabriel Godoy","Rômulo Arantes Neto","Letícia Isnard","Solange Teixeira"],"trailer":"XvvK4QZHhl0","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/omkz52Su5eyFOQnc8klBWRaJpT.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/omkz52Su5eyFOQnc8klBWRaJpT.jpg","air_date":"2021-10-01","episode_count":7,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Desjuntar","overview":"Caco e Camila se conhecem num cruzeiro quando precisam dividir uma cabine e acabam se casando. Mas agora a famosa crise dos sete anos faz com que eles se separem. O problema é que a falta de dinheiro obriga os dois a continuarem morando juntos no mesmo apartamento.","air_date":"2021-10-01","runtime":0,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"2":{"name":"Desconcertar","overview":"Para salvar o apartamento, Camila aluga seu quarto na internet. Caco não aguenta os hóspedes e pede ajuda para o seu melhor amigo. Já Camila reconquista a ex-melhor amiga. Agora os amigos vão arrastar Caco e Camila para a vida de solteiros outra vez.","air_date":"2021-10-01","runtime":0,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"3":{"name":"Desarranjar","overview":"Caco se dá conta que não pode mais ficar esperando a indenização e precisa agir para ganhar dinheiro. Junto com Marcinho, ele começa um novo negócio na varanda do apartamento, o que acaba atrapalhando o trabalho de Camila.","air_date":"2021-10-01","runtime":0,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"4":{"name":"Desmoronar","overview":"Caco precisa pedir ajuda aos pais para não perder o apartamento, enquanto Camila se lança como blogueira para alavancar seus negócios com as redes sociais e acaba conhecendo Roberto Carlos.","air_date":"2021-10-01","runtime":0,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"5":{"name":"Deslumbrar","overview":"Camila tem seu primeiro encontro com Roberto Carlos, mas não quer se envolver com um homem tão bonito. Enquanto isso, Caco corre atrás de um sonho de infância.","air_date":"2021-10-01","runtime":0,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"6":{"name":"Desapegar","overview":"Enquanto Caco e Roberto Carlos brigam por uma camisa velha, Paty e Marcinho tentam mostrar para Camila que talvez Caco sinta sua falta.","air_date":"2021-10-01","runtime":0,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"7":{"name":"Despertar","overview":"Camila prepara sua mudança para morar com Roberto Carlos, enquanto Caco tenta lidar com a falta de Camila.","air_date":"2021-10-01","runtime":0,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}}}},
